export default function Header() {
  return (
    <>
      <h1 className="text-3xl font-bold">Genera</h1>
      <div>
        <button className="border-2 border-sky-500">Sign In</button>
        <button className="border-2 border-sky-500">Sign Up</button>
        <button className="border-2 border-sky-500">Explore</button>
      </div>
    </>
  );
}
